import React from 'react'
import './Form.css'
import img from '../Images/contact2.jpg'

const Form = () => {
  return (
    <div>
      <div class="modal-box" >
<img class="banner-img-suggest"  src={img} ></img> 

          <div class='modal-div'>

       <p class='suggest-subheader'>Get In Touch</p>
       <div class='input-suggest-flexbox' >
       <div style={{margin:'3vh 4vh'}}>
       <p class='input-header' id="NAME">Doctor' s Name</p>
         <input class='input-box' style={{'width':'100%','borderRadius': 'none'}} type="text" placeholder='Dr. John'></input>

       </div>

       <div style={{margin:'3vh 4vh'}}>
       <p class='input-header' id="CONTACT">Contact</p>
         <input class='input-box' style={{'width':'100%'}}  type="text" placeholder='9152345677'></input>

       </div>
       </div>
       <div class='input-suggest-flexbox'>
       <div style={{margin:'3vh 4vh'}}>
       <p class='input-header' id="EMAIL">Email</p>
         <input class='input-box' style={{'width':'100%'}} type="text" placeholder='john@gmail.com'></input>

       </div>

       <div style={{margin:'3vh 4vh'}}>
       <p class='input-header' id="SUBJECT">Subject</p>
         <input class='input-box' style={{'width':'100%'}}  type="text" placeholder='Hey'></input>

       </div>
       </div>

       <div style={{margin:'4vh'}}>
       <p class='input-header' id="TEXT">Message</p>
        <textarea class='suggest-textarea' cols="43" rows="3" placeholder='Hello!'></textarea>

       </div>
       <button class='suggest-btn' id="send_button">Send</button>
     </div>
     </div>
    </div>
  )
}

export default Form



